private static Long parseLimitString(String limitString) {
  Long limit = null;
  if (limitString != null) {
    if (limitString.equalsIgnoreCase("unlimited")) {
      limit = CachePoolInfo.LIMIT_UNLIMITED;
    } else {
      limit = Long.parseLong(limitString);
    }
  }
  return limit;
}
